  const handleChange = (e) => {
    setTitle(e.target.value);
  };
  const handleClick = () => {
    setTitle("");
  };

  return (
    <div>
      <input type="text" placeholder="Enter Title" onChange={handleChange} />
      <button onClick={handleClick}>Add</button>
    </div>
  );
};

